import axios from 'axios';
import React from 'react';

function LoginPage() {
  // debugger;
  const login = () => {
    axios
      .post('/login', (req, res) => {
        // ...
        // ---

        console.log("req.data: ", req.data);
        console.log("res.data: ", res.data);
      })
      .then((data) => {
        // ...
        // ---

        console.log(data);
      })
      .catch((err) => {
        // ...
        // ---

        console.log(err);
      })
  }

  return (
    // <div>
    //   LoginPage
    // </div>
    <div className='App'>
      <h1>LOGIN</h1>
      <h2>Please login below to see your budget details...</h2>
      <br/>
      <label>
        <h2>Username:</h2>
        {/* <img src='' alt='login icon'/><span style={{'padding-right':  10}}/> */}
        <input className='icon un' name='username' type='text' placeholder='Enter your username here...' autoFocus required/>
      </label>
      <br/><br/>
      <label>
        <h2>Password:</h2>
        {/* <img src='' alt='password icon'/><span style={{'padding-right':  10}}/> */}
        <input className='icon pw' name='password' type='password' placeholder='Enter your password here...' required/>
      </label>
      <br/><br/><br/>
      <button className='login-button' type='submit' onClick={login}>Login</button>
      <br/><br/>
    </div>
  );
}

export default LoginPage;
